import React, { Component } from 'react'

class Register extends Component {

    constructor(){
        super();
        this.state = {
            name: '',
            email: '',
            password: '',
            con_password: '',
            session: '',
            nameError: '',
            emailError: '',
            passwordError: '',
            con_passwordError: '',
            errors: {}
        };
        
        this.inputChange = this.inputChange.bind(this)
    }

    inputChange = input => e => {
        this.setState({
            [input]: e.target.value
        })
    }

    
    continue = e => {

        e.preventDefault();

        if(!this.state.name){
            this.setState({
                nameError: 'Please enter name',
                emailError: '',
                passwordError: '',
                con_passwordError: '',
            })
        }else if(!this.state.email){
            this.setState({
                nameError: '',
                emailError: 'Please enter email',
                passwordError: '',
                con_passwordError: '',
            })
        }else if(!values.password){
            this.setState({
                nameError: '',
                emailError: '',
                passwordError: 'Please enter password',
                con_passwordError: '',
            })
        }else if(!values.con_password){
            this.setState({
                nameError: '',
                emailError: '',
                passwordError: '',
                con_passwordError: 'Please enter confirm password',
            })
        }else if(values.con_password!==values.password){
            this.setState({
                nameError: '',
                emailError: '',
                passwordError: '',
                con_passwordError: 'Password does not match',
            })
        }else{

            var allStates = this.state
            var allValues = this.props

            axios
            .post('http://127.0.0.1:8000/api/register', {allStates: allStates,allValues: allValues}, {
                headers: { 'Content-Type': 'application/json' }
            })
            .then(response => {
                alert(response.data.returnArray.message)
            })
            .catch(err => {
                console.log('Something !')
            })
        }

    };


    render () {

        const { name, email, password, con_password, session } = this.state;
        const values = {  name, email, password, con_password };

        // const { inputChange } = this.props;

        return (
            <div className="form-container">


                <br/>
                <br/>
                <h1 className="h3 mb-3 font-weight-normal h1-custom">Register</h1>


                <div className="form-css col-md-6 mt-5 mx-auto">

                    <div className="form-group">
                        <label htmlFor="name">Name</label>
                        <input type="text" className="form-control" name="name" onChange={inputChange('name')} value={values.name} />
                        <p>{this.state.nameError}</p>
                    </div>

                    <div className="form-group">
                        <label htmlFor="email">Email</label>
                        <input type="email" className="form-control" name="email" onChange={inputChange('email')} value={values.email} />
                        <p>{this.state.emailError}</p>
                    </div>

                    <div className="form-group">
                        <label htmlFor="password">Password</label>
                        <input type="password" className="form-control" name="password" onChange={inputChange('password')} value={values.password} />
                        <p>{this.state.passwordError}</p>
                    </div>
                    <div className="form-group">
                        <label htmlFor="password">Confirm Password</label>
                        <input type="password" className="form-control" name="con_password" onChange={inputChange('con_password')} value={values.con_password} />
                        <p>{this.state.con_passwordError}</p>
                    </div>


                    <br />

                    <div className="row">
                        <div className="col-6 text-right">
                            <button className="btn btn-primary" onClick={this.continue}>Submit</button>
                        </div>
                    </div>

                </div>

                <br/>
                <br/>
                <br/>

            </div>
        )
    }
}

export default Register
